a:17:{s:4:"name";s:19:"Cialis Professional";s:11:"small_descr";s:299:"Cialis Professional is essentially a "new and improved" formula of the original Cialis®. While the product has been reformulated and enhanced in its chemical compound, it still treats erectile dysfunction in men much like the first tadalafil tablet, yet reaches a larger majority with its efficacy.";s:14:"small_descr_de";s:96:"Cialis Professional ist eine neue und verbesserte Formel von dem ursprünglichen Medizin Cialis.";s:14:"small_descr_fr";s:92:"Cialis Professional affecte la réponse à la stimulation sexuelle et améliore l'érection.";s:14:"small_descr_es";s:177:"El Cialis Professional es una fórmula "innovadora e avanzada " del fármaco original Cialis. El Cialis mejora las erecciones y permite conseguir un transursco sexual eficiente.";s:14:"small_descr_it";s:96:"Cialis migliora l'erezione e permette di raggiungere un soddisfacente rapporto sessuale sessuali";s:10:"full_descr";s:5265:"<p><strong>What is this medicine?</strong><br /><br />TADALAFIL tablets are used to treat erection problems in men. One of the main benefits of Cialis Professional is the heightened sensitivity to the penis. This means that it should take less stimulation to achieve an erection for those individuals suffering from erectile dysfunction, though stimulation must still be present. In addition to the increased sensitivity, men have also been said to experience longer effects with this new formula of tadalafil, setting the response period from anywhere between 38 and 48 hours.<br /><br /><strong>What should I tell my health care provider before I take this medicine?</strong><br /><br />They need to know if you have any of these conditions:<br />eye or vision problems, including a rare inherited eye disease called retinitis pigmentosa<br />heart disease, angina, a history of heart attack, irregular heart beats, or other heart problems<br />high or low blood pressure<br />kidney or liver disease<br />stroke<br />an unusual or allergic reaction to tadalafil, other medicines, foods, dyes, or preservatives<br /><br /><strong>How should I use this medicine?</strong><br /><br />Cialis Professional is taken as needed 15-20 min before sexual activity. Because Cialis Professional is chewed, the effects typically start much sooner compared with orally consumed medicines.  This is due to the "rapid chemical uptake" of this new formula, adding a great deal more flexibility to the treatment plan of a given individual.<br /><br />You should not take this dose more than once per day. Do not take your medicine more often than directed.<br /><br /><strong>Overdosage:</strong> <br /><br />If you think you have taken too much of this medicine contact a poison control center or emergency room at once.<br /><br /><strong>NOTE: </strong><br /><br />This medicine is only for you. Do not share this medicine with others.<br /><br /><strong>What may interact with this medicine?</strong><br /><br />Do not take this medicine with any of the following medications:<br />nitrates like amyl nitrite, isosorbide dinitrate, isosorbide mononitrate, nitroglycerin<br /><br />This medicine may also interact with the following medications:<br />certain drugs for high blood pressure<br />certain drugs for the treatment of HIV infection or AIDS<br />certain drugs used for fungal or yeast infections, like fluconazole, itraconazole, ketoconazole, and voriconazole<br />certain drugs used for seizures like carbamazepine, phenytoin, and phenobarbital<br />grapefruit juice<br />macrolide antibiotics like clarithromycin, erythromycin, troleandomycin<br />medicines for prostate problems<br />rifabutin, rifampin or rifapentine<br /><br />This list may not describe all possible interactions. Give your health care provider a list of all the medicines, herbs, non-prescription drugs, or dietary supplements you use. Also tell them if you smoke, drink alcohol, or use illegal drugs. Some items may interact with your medicine.<br /><br /><strong>What should I watch for while using this medicine?</strong><br /><br />If you notice any changes in your vision while taking this drug, call your doctor or health care professional as soon as possible. Stop using this medicine and call your health care provider right away if you have a loss of sight in one or both eyes.<br /><br />Contact you doctor or health care professional right away if the erection lasts longer than 4 hours or if it becomes painful. This may be a sign of serious problem and must be treated right away to prevent permanent damage.<br /><br />If you experience symptoms of nausea, dizziness, chest pain or arm pain upon initiation of sexual activity after taking this medicine, you should refrain from further activity and call your doctor or health care professional as soon as possible.<br /><br />Do not drink alcohol to excess (examples, 5 glasses of wine or 5 shots of whiskey) when taking this medicine. When taken in excess, alcohol can increase your chances of getting a headache or getting dizzy, increasing your heart rate or lowering your blood pressure.<br /><br />Using this medicine does not protect you or your partner against HIV infection (the virus that causes AIDS) or other sexually transmitted diseases.<br /><br /><strong>What side effects may I notice from this medicine?</strong><br /><br />Side effects that you should report to your doctor or health care professional as soon as possible:<br />allergic reactions like skin rash, itching or hives, swelling of the face, lips, or tongue<br />breathing problems<br />changes in hearing<br />chest pain<br />fast, irregular heartbeat<br /><br />Side effects that usually do not require medical attention (report to your doctor or health care professional if they continue or are bothersome):<br />back pain<br />dizziness<br />flushing<br />headache<br />indigestion<br />muscle aches<br />stuffy or runny nose<br /><br />This list may not describe all possible side effects.<br /><br /><strong>Where should I keep my medicine?</strong><br /><br />Keep out of the reach of children.<br /><br />Store at room temperature between 15 and 30 degrees C (59 and 86 degrees F). Throw away any unused medicine after the expiration date.</p>";s:13:"full_descr_de";s:3497:"<p><strong>Details</strong><br /><br />Cialis Professional ist ein neu erarbeitetes und chemisch gepr&uuml;ftes rezeptpflichtiges Arzneimittel, das oral zur Behandlung der erektilen Dysfunktion nur von M&auml;nnern einzunehmen ist. Es erh&ouml;ht zu h&ouml;chstem Grad m&auml;nnliche sexuelle Aktivit&auml;t, was zur hohen Penispotenx, multiplen Orgasmen und verg&ouml;&szlig;ertem Penis f&uuml;hrt.<br /><br /><strong>Vorteile:</strong><br /><br />&bull; 36-48 Stunden Reaktionsperiode;<br />&bull; H&ouml;hepunkt Ihrer sexuellen Konzentration;<br />&bull; Penisnervenreiz;<br />&bull; Unaufh&ouml;rliche Lust;<br />&bull; Stimulierte m&auml;nnliche Ausdauerf&auml;higkeit;<br />&bull; Schnelle chemische Resorption;<br />&bull; Sensationelle H&auml;rte und Festigkeit;<br />&bull; Prolongierte sexuellel Aktivit&auml;t;<br />&bull; Frieden und Phantasie in der Seele.<br /><br /><strong>Behandlung</strong><br /><br />Cialis Professional wird den meisten an erektilen Dysfunktion leidenden M&auml;nnern helfen, ihre F&auml;higkeit wiederzubeschaffen, phantastische Erektionen zu erreichen, die gen&uuml;gen werden, um ihre sexuelle Erfahrungen zu verbessern.<br /><br />Einnahme von Cialis Professional etwa 20 bis 30 Minuten vor Ihrem Geschlechtsakt wird Sie komfortabel f&uuml;hlen lassen und auch Ihnen erlauben, sich nach allen Liebreizen zu streben, die mit Befriedigung Ihrer besseren H&auml;lfte verbunden sind.<br /><br />Beachten Sie auch, da&szlig; Cialis Professional unempfindlich f&uuml;r jede fetthaltigen Mahlzeiten (wie, z.B., Fisch&amp;Chips, Cheeseburger oder Pommes frites) oder Getr&auml;nke ist. Cialis Professional l&auml;&szlig;t Sie Ihrem Partner in allen passenden Situationen zu antworten. Sie k&ouml;nnen Cialis Professional im voraus einnehmen, so da&szlig; Sie und Ihr Partner Zeit haben, damit die Intimit&auml;tsperiode sich spontan entwickelt.<br /><br /><strong>Medizinklasse und Mekanismus:</strong><br /><br />Cialis Professional verbessert den Einflu&szlig; des Stickstoffoxyds auf Nervenendigung und Endothelzellen in dem Corpus cavernosum mit der 5-Typ-Phosphodiesterase-Hemmung in den Penisschwellk&ouml;rpern. Es bringt zur Gef&auml;&szlig;erweiterung, zu verst&auml;rktem Blutzuflu&szlig; in den Corporus cavernosum und zum Entstehen einer Peniserektion nach sexueller Stimulation.<br /><br />Also, mit der v&ouml;lligsten Entspannung der glatten Muskeln von Blutgef&auml;&szlig;en, der verst&auml;rkte Blutzuflu&szlig; zum Penis wird Ihre Erektion und Ihren sexuellen Zustand bis zu unglaublichen Schranken.<br /><br />Falls Sie in Ihrem Geschlechtsleben einige Pausen erleben, dann bitte keine Verlegenheit, erschweren Sie Ihr Leben nicht mehr. Eine kleine Pille wird alle Ihre Zweifel benehmen und ein Leben wiederherstellen, auf welches Sie schon nicht mehr gehofft haben.<br /><br /><strong>Dosierung :</strong><br /><br />Wenn Sie eine Gabe des Cialis Professional ausgelassen haben, nehmen Sie sie so schnell wie m&ouml;glich. Wenn es schon fast Zeit f&uuml;r Ihre n&auml;chste Gabe, dann &uuml;berspringen Sie die ausgelassene Dosis und kommen Sie zu Ihrem regelm&auml;&szlig;igen Dosierungsschema zur&uuml;ck.<br />Nehmen Sie keinesfalls 2 Gaben gleichzeitig ein.<br /><br /><strong>Lagerung :</strong><br /><br />Cialis Professional bei der Raumtemperatur von 68-77 Grad Fahrenheit (20-25 Grad Celsius) aufbewahren. Entfernt von W&auml;rmequellen, Feuchte und Licht aufbewahren.<br />Cialis Professional vor Kindern und Haustieren bewahren.</p>";s:13:"full_descr_fr";s:4017:"<p><strong>D&eacute;tails</strong><br /><br />Cialis Professional est une nouvelle pilule qui est prise par voie orale pour le traitement de la dysfonction &eacute;rectile seulement chez les hommes, en am&eacute;liorant extr&ecirc;mement l&rsquo;activit&eacute; sexuelle masculine, le pouvoir de stimuler le p&eacute;nis, multiples orgasmes et augmentant la taille du p&eacute;nis.<br /><br /><strong>B&eacute;n&eacute;fices:<br /></strong><br />* P&eacute;riode de l'effet de la pilule: 36-48 heures;<br />* Meilleure concentration sexuelle;<br />* D&eacute;sir sexuel en continuation;<br />* Absorption rapide de la pilule;<br />* Activit&eacute; sexuelle prolong&eacute;e;<br /><br /><strong>Mode d'emploi<br /></strong><br />Cialis Professional aide la grande majorit&eacute; des personnes souffrant de dysfonction &eacute;rectile &agrave; retrouver la capacit&eacute; d'obtenir et de maintenir une bonne &eacute;rection, ce qui suffit &agrave; am&eacute;liorer leurs exp&eacute;riences sexuelles.<br /><br />En prenant Cialis Professional environ 20-30 minutes avant l'activit&eacute; sexuelle, vous vous sentirez excit&eacute; et avec une &eacute;rection plus forte et durable.<br /><br />Notez que Cialis Professional est indiff&eacute;rent &agrave; tout aliment gras (frites fran&ccedil;aises, hamburgers, etc.) ou des boissons. Cialis Professional vous permet de satisfaire votre partenaire au bon moment. Cialis Professional peut &ecirc;tre pris &agrave; l'avance et votre partenaire peut prendre son temps pour accro&icirc;tre l&rsquo;intimit&eacute; et le r&eacute;sultat est tout &agrave; fait naturel, spontan&eacute;.<br /><br /><strong>Type de m&eacute;dicament et m&eacute;canisme<br /></strong><br />En g&eacute;n&eacute;ral, les traitements chimiques sont sous forme de pilules qui sont pris par voie orale par les personnes souffrant de dysfonction &eacute;rectile. Nous avons choisi une autre approche, non seulement dans la m&eacute;thode d'action mais aussi celui visant la forme de la pilule, il s'agit d'une pilule molle, g&eacute;latineuse, qui a un temps d'absorption plus rapide de l&rsquo;ingr&eacute;dient actif et il est indiff&eacute;rent aux autres sous-produits ing&eacute;r&eacute;s.<br /><br />Outre la pr&eacute;cision et la s&ucirc;ret&eacute; de l'effet du Cialis Professional, cette pilule est une action d&rsquo;am&eacute;lioration et de renforcement des vasodilatateurs. Cialis Professional &eacute;largit les vaisseaux sanguins permettant une am&eacute;lioration substantielle de l'afflux de sang.<br /><br />L'un des plus grands avantages du Cialis Professional c'est la fonction d'am&eacute;liorer le rel&acirc;chement de l'oxyde nitrique dans le corps qui pr&eacute;voit une forte stimulation de la concentration de GMPc, ou GMP cyclique. Cela d&eacute;tend les corps caverneux du p&eacute;nis, permettant l'afflux sang pour une p&eacute;riode de longue dur&eacute;e et ensuite une &eacute;rection plus durable.<br /><br />Cialis Professional peut &eacute;galement agir comme un g&eacute;n&eacute;rateur de testost&eacute;rone, ce qui augmente la propre libido et la quantit&eacute; de sperme en r&eacute;duisant l'infertilit&eacute; masculine.<br /><br /><strong>Dose oubli&eacute;e<br /></strong><br />Si vous oubliez une dose de Cialis Professional, et que vous utilisez le produit r&eacute;guli&egrave;rement, vous devriez prendre la pilule d&egrave;s que possible. S'il y a assez temps de la dose suivante, sauter la dose oubli&eacute;e et revenir &agrave; l'usage r&eacute;gulier. Ne jamais prendre 2 doses &agrave; la fois.<br /><br /><strong>Stockage</strong><br /><br />Gardez Cialis Professional entre 20 et 25 &deg; C. Pour le stockage de courte dur&eacute;e, la temp&eacute;rature entre 15 et 30 &deg; C est autoris&eacute;. &Agrave; conserver &agrave; l'abri de la chaleur, humidit&eacute; et lumi&egrave;re. Ne pas stocker dans la salle de bains. Tenir hors de la port&eacute;e des enfants et des animaux.chement de l'oxyde nitrique dans le corps qui pr</p>";s:13:"full_descr_es";s:4341:"<p><strong>Detalles</strong><br /><br />Cialis Professional (Tadalafil) multiplica los orgasmos que se pueden alcanzar durante una jornada ya que aumenta de manera considerable la sensaci&oacute;n de deseo. Este producto funciona adem&aacute;s aumentando el tama&ntilde;o del pene, por lo que el sexo resulta m&aacute;s gozoso y placentero tanto para el hombre que tome las p&iacute;ldoras como para su acompa&ntilde;ante.Luego de tomar Cialis Professional (Tadalafil) sentir&aacute; que el pene alcanzar&aacute; una dureza mayor a la ya experimentada y una sensaci&oacute;n de firmeza novedosa. Para aquellos pacientes que no logran perdurar en el acto sexual el tiempo necesario para aumentar los niveles de placer que experimenta el organismo a la hora de tener sexo, el Cialis Professional (Tadalafil) har&aacute; que alcance relaciones sexuales m&aacute;s prolongadas. Se trata de un producto para tratar la llamada com&uacute;nmente impotencia aprobado por la Administraci&oacute;n de Drogas y Alimentos y es altamente confiable.<br /><br /><strong>C&oacute;mo est&aacute; compuesto Cialis Professional (Tadalafil)</strong><br /><br />Cialis Professional (Tadalafil) estimula el efecto del &oacute;xido n&iacute;trico en las terminaciones nerviosas y activa el flujo de sangre hacia el pene, por lo que ayuda a mantener con vigor la erecci&oacute;n. Cada comprimido de Cialis Professional (Tadalafil) posee Tadalafil como principio activo y excipientes.<br /><br /><strong>C&oacute;mo tomar Cialis Professional (Tadalafil)?<br /></strong><br />Cialis Professional (Tadalafil) es un medicamento que se administra por v&iacute;a oral y puede ser suministrado en compa&ntilde;&iacute;a o no de alimentos. Tome una tableta alrededor de 20 a 30 minutos antes de iniciar la relaci&oacute;n sexual y se sentir&aacute; mucho m&aacute;s motivado y deseoso. No ingiera dos o m&aacute;s dosis juntas ya que la sobredosis no potencia los efectos y puede provocar consecuencias en su salud.<br /><br />Cialis Professional (Tadalafil) nunca debe ser combinado con otros productos farmacol&oacute;gico o tratamientos para la disfunci&oacute;n er&eacute;ctil. Tampoco se debe tomar en conjunto con bebidas alcoh&oacute;licas u otros medicamentos, ya que la mezcla puede provocar o sostener algunos efectos adversos. Antes de utilizar este producto, realice una cita con su m&eacute;dico de confianza. El le preguntar&aacute; por su historia cl&iacute;nica, los medicamentos que consume y a qu&eacute; sustancias es hipersensible.<br /><br />Cialis Professional (Tadalafil) es un estimulador, por lo tanto, no frena el riesgo de contagio de las enfermedades de transmisi&oacute;n sexual y tampoco evita el embarazo. Para cuidarse en una relaci&oacute;n, ya sea ocasional o estable, se recomienda elegir un m&eacute;todo anticonceptivo.<br /><br /><strong>Contraindicaciones<br /></strong><br />No deben consumir este f&aacute;rmaco:<br />&bull; Personas al&eacute;rgica a cualquiera de sus ingredientes activos.<br />&bull; Pacientes con problemas de coraz&oacute;n.<br />&bull; Personas que lleven adelante tratamientos con nitratos como el nitroprusiato y el isorbide.<br />&bull; Hombres a quienes, por sus problemas card&iacute;acos, tienen prohibido mantener relaciones sexuales.<br />&bull; Aquellos que utilicen drogas recreativas como el "popper".<br /><br /><strong>Efectos Adversos<br /></strong><br />&bull; Mareo<br />&bull; Nauseas<br />&bull; Somnolencia<br />&bull; Desmayos<br />&bull; Visi&oacute;n borrosa<br /><br /><strong>Frente a los siguientes s&iacute;ntomas, programe una visita a un profesional:<br /></strong><br />&bull; Reacci&oacute;n al&eacute;rgica al producto<br />&bull; Dolor de pecho o taquicardia<br />&bull; Tobillos y piernas hinchadas<br />&bull; Falta de aliento<br />&bull; Mareos severo<br />&bull; Erecciones muy prolongadas o acompa&ntilde;adas de dolor<br /><br /><strong>Conservaci&oacute;n del producto<br /></strong><br />La conservaci&oacute;n del Cialis Professional (Tadalafil) se debe efectuar en un lugar sin humedad y calor excesivo, por lo que no se recomienda guardar el producto en el ba&ntilde;o o en la cocina. Tampoco someta las pastillas al rayo directo de la luz. No tome p&iacute;ldoras que provengan de envases rotos y adulterados y cuide que no quede al alcance de los ni&ntilde;os.</p>";s:13:"full_descr_it";s:3586:"<p><strong>Dettagli</strong><br /><br />Cialis professional &egrave; una nuova pillola che va presa oralmente, per il trattamento della disfunzioneerettile solo negli uomini, specificatamente accresce l&rsquo;attivit&agrave; sessuale maschile stimolando la potenza del pene, maggiori orgasmi e aumentando la misura del pene.<br /><br /><strong>Benefici:<br /></strong><br />* Periodo dell&rsquo;effetto della pillola: 36-48 ore;<br />* Massima concentrazione sessuale;<br />* Desiderio sessuale continuo;<br />* Assorbimento rapido della pillola;<br />* Prolungata attivit&agrave; sessuale;<br /><br /><strong>Istruzioni per l&rsquo;uso<br /></strong><br />Cialis professional la maggior parte delle persone che soffrono di disfunzione erettile restituendo a loro la capacit&agrave; di raggiungere e mantenere una buona erezione, sufficiente abbastanza per migliorare le proprie esperienze sessuali.<br /><br />Prendendo il cialis professional circa 20-30 minuti prima dell&rsquo;attivit&agrave; sessuale vi sentirete eccitati e con un&rsquo;erezione pi&ugrave; forte e duratura.<br /><br />Da notare che il cialis professional &egrave; indifferente a qualsiasi cibo grasso (come patatine fritte, hamburger ecc.) o bevande. Cialis professional vi permette di soddisfare la propria partner al momento giusto. Il cialis professional si pu&ograve; prendere in anticipo e la propria partner pu&ograve; prendersi il suo tempo per aumentare l&rsquo;intimit&agrave; e tutto risultare del tutto naturale, spontaneo.<br /><br /><strong>Tipo di farmaco e meccanismo</strong><br /><br />Generalmente, i trattamenti chimici sono sottoforma di pillole che vengono prese oralmente per chi soffre di disfunzione erettile. Noi abbiamo scelto un altro approccio non solo riguardo al metodo di azione ma anche alla forna della pillola, si tratta di una pillola molle, gelatinosa, che ha un tempo di assorbimento pi&ugrave; veloce del maggior ingrediente attivo ed &egrave; indefferente agli altri sottoprodotti ingeriti.<br /><br />Oltre all&rsquo;accuratezza e alla sicurezza dell&rsquo;effetto del cialis professional, questa pillola ha un miglioramento e un potenziamento dell&rsquo;azione vasodilatante. Cialis professional allarga i vasi sanguigni pemettendo un cospicuo miglioramento dell&rsquo;afflusso del sangue.<br /><br />Uno dei maggiori comprensivi vantaggi del cialis professional &egrave; la funzione di migliorare il rilascio dell&rsquo;ossido nitrico nel corpo, il quale provvede a una forte stimolazione del livello del cGMP, or GMP ciclico. Questo rilassa i corpi cavernosi del pene permettendo l&rsquo;afflusso di pi&ugrave; sangue per un periodo di maggior durata, e quindi un&rsquo;erezione pi&ugrave; duratura.<br /><br />Cialis professional pu&ograve; anche agire come generatore di testosterone che aumenta la propria libido e la quantit&agrave; di sperma, riducendo l&rsquo;infertilit&agrave; maschile.<br /><br /><strong>Dose dimenticata</strong><br /><br />Se si dimentica una dose di Cialis professional e si sta usando il prodotto regolarmente, &egrave; bene prendere la pillola il prima possibile. Se c'&egrave; abbastanza tempo dalla dose successiva, saltare la dose dimenticata e ritornare all'uso regolare. Non prendere mai 2 dosi in una volta sola.<br /><br /><strong>Conservazione<br /></strong><br />Conservare cialis professional tra i 20 e i 25&deg; C. Per la conservazione breve tra i 15 e i 30&deg; C &egrave; permesso. Da conservare lontano dal calore, umidit&agrave; e luce. Non conservare in bagno. Tenere lontano dalla portata dei bambini e degli animali.</p>";s:9:"min_price";s:9:"1.2026088";s:9:"pack_name";s:5:"pills";s:4:"type";s:2:"mg";s:7:"analogs";a:21:{s:6:"Cialis";s:20:"Erectile Dysfunction";s:12:"Brand Cialis";s:20:"Erectile Dysfunction";s:19:"Ci